class HomeMap extends React.Component {
    constructor(props) {
        console.log("constructor");
        super(props);

    }

    componentWillReceiveProps(nextProps) {
        conMapRotateX = nextProps.conMapRotateX;
        conMapRotateY = nextProps.conMapRotateY;
        //添加点的
        let nationalCtlPointInfos = nextProps.nationalCtlPointInfos || [],
            webDeviceInfos = nextProps.webDeviceInfos || [];
        let clickWebDevice = nextProps.clickWebDevice,
            clickNationalCtlPoint = nextProps.clickNationalCtlPoint;
        nationalCtlPointInfos.map(function (item, index) {
            let content = `<div class=${styles.sitBox}>
            <div class="${styles.panelTitle}">${item.name}</div>  
            <div class="${styles.panelContent}">${item.rate}</div>
            </div>
            <img src=${item.state ? nationalCtlPointIcon : nonationalCtlPointIcon}>`;
            new window.AMap.Marker({
                map: map,
                index: index,
                content: content,
                position: [item.longitude, item.latitude],
                icon: new window.AMap.Icon({
                    size: new window.AMap.Size(40, 50),  //图标大小
                    image: item.state ? nationalCtlPointIcon : nonationalCtlPointIcon
                })
            }).on("click", (e) => {
                clickNationalCtlPoint(e)(e.target.F.index);
            })
        });
        webDeviceInfos.map(function (item, index) {
            let content = `<img src=${item.state ? webDeviceIcon : nowebDeviceIcon}>
            <div class =${styles.nationalSiteStyle}>${item.name}</div>`;
            new window.AMap.Marker({
                map: map,
                index: index,
                content: content,
                position: [item.longitude, item.latitude],
                icon: new window.AMap.Icon({
                    size: new window.AMap.Size(40, 50),  //图标大小
                    image: item.state ? webDeviceIcon : nowebDeviceIcon
                })
            }).on("click", (e) => {
                clickWebDevice(e)(e.target.F.index);
            })
        })

        let cus;
        if (nextProps.coneMap) {
            if (nextProps.conMapMoveType === "X") {
                surface.xRotate(conMapRotateX);
            } else {
                surface.yRotate(conMapRotateY);
            }
            nextProps.coneMap.render();
        } else {
            //添加自定义图层 也就是立体锥形图
            map.plugin(['AMap.CustomLayer', 'AMap.DistrictSearch'], function () {
                canvas = document.createElement('canvas');
                canvas.width = map.getSize().width;
                canvas.height = map.getSize().height;
                cus = new window.AMap.CustomLayer(canvas, {
                    zooms: [3, 20],
                    zIndex: 1999,
                    opacity: 0.7
                });
                nextProps.setConeMap()(cus);
                cus.render = this.onRender;
                cus.setMap(map);
            }.bind(this));
        }


    }
    componentWillUpdate(nextProps, nextState) {
        console.log("componentWillReceiveProps");
        //地图定位到中心店
        this.setCenter(nextProps);
        //设置是否添加卫星图
        if (nextProps.chartType === "satellitemap") { //这是热力图
            nextProps.satellite.show(); //显示卫星图
            nextProps.coneMap.hide(); //关闭锥形图
            nextProps.heatmap.show();
            nextProps.heatmap.setDataSet({ data: nextProps.heatmapPoints }); // 热力图
        } else {
            nextProps.satellite.hide(); //关闭卫星图
            if (nextProps.coneMap) {
                nextProps.coneMap.show(); //显示锥形图
            }
            nextProps.heatmap.hide();
        }

    }


    componentDidMount() {
        map = new window.AMap.Map('container', {
            zoom: [3, 20],
            center: [117.152262, 31.856611],
            resizeEnable: true,
            rotateEnable: true,
            pitchEnable: true,
            zoom: 17,
            pitch: 80,
            viewMode: '3D',//开启3D视图,默认为关闭
            buildingAnimation: true,//楼块出现是否带动画
            expandZoomRange: true,
        });
        map.plugin(["AMap.ControlBar"], function () {
            //map.addControl(new window.AMap.ToolBar());
            let controlBar = new window.AMap.ControlBar({
                showZoomBar: true,
                showControlButton: true,
                position: {
                    left: '-70px',
                    top: '10px'
                }
            });
            map.addControl(controlBar);
        });


        let satellite = new window.AMap.TileLayer.Satellite({
            map: map,
            zIndex: 10
        });
        if (this.props.chartType === "normalmap") { //如果是第一个  隐藏卫星图
            satellite.hide();
        };

        let heatmap;
        let _self=this;
       // if (!window.AMap.Heatmap) {
            map.plugin(["AMap.Heatmap"], function () {
                //初始化heatmap对象
                heatmap = new window.AMap.Heatmap(map);
                //回调父页面 将map对象和卫星图传递出去
                _self.props.MapDidMount()(map, satellite, heatmap);
            });
        //}


    }

    render() {
        return (
            <div className={styles.right} id="container" >

            </div>
        )
    }
    /*
        绘制锥形图方法
    * */
    onRender = () => {
        surface.generate();
        surface.color();
        appendCanvasElement();
        surface.xRotate(conMapRotateX);
        surface.yRotate(conMapRotateY);
        let context = canvas.getContext('2d');
        let containerPos = map.lngLatToContainer(new window.AMap.LngLat(117.152023, 31.856767));
        context.drawImage(myCanvas,
            containerPos.x - surface.constants.canvasWidth / 2,
            containerPos.y - surface.constants.canvasWidth / 2
        );
    }

    //定位到地图的中心点
    setCenter = (nextProps) => {
        let lnglat;
        if (nextProps.webDeviceInfo) {
            lnglat = [nextProps.webDeviceInfo.longitude, nextProps.webDeviceInfo.latitude];
        } else if (nextProps.nationalCtlPointInfo) {
            lnglat = [nextProps.nationalCtlPointInfo.longitude, nextProps.nationalCtlPointInfo.latitude];
        }
        nextProps.map?nextProps.map.setCenter(lnglat):null;
    }

}



let constants = {
    canvasWidth: 600,
    canvasHeight: 600,
    leftArrow: 37,
    upArrow: 38,
    rightArrow: 39,
    downArrow: 40,
    r: 9,//圆锥的半径
    Delta: 0.05, // 创建点坐标的比例
    colorMap: ["#060", "#090", "#0C0", "#0F0", "#9F0", "#9C0", "#990", "#960", "#930", "#900", "#C00"], // 默认的颜色
    pointWidth: 2, //画出来的点的尺寸
    pointHeight: 1,
    dTheta: 0.05, // 鼠标按下时候 旋转的比例
    surfaceScale: 24, // 缩放的比例
    split: 0.4
};

// 定义x,y,z对应的数组位置
const X = 0;
const Y = 1;
const Z = 2;

// -----------------------------------------------------------------------------------------------------

let controlKeyPressed = false;

let surface = new Surface();

// -----------------------------------------------------------------------------------------------------

function point(x, y, z) //转化为立体坐标
{
    return [x, y, z];
}


function Surface() {
    this.points = [];
    this.constants = constants;
}

// -----------------------------------------------------------------------------------------------------

Surface.prototype.equation = function (x, y) {
    return 1 * Math.sqrt(x * x + y * y); //返回矩形
}

// -----------------------------------------------------------------------------------------------------

Surface.prototype.generate = function () {
    var i = 0;
    var time = 72;
    for (var k = 0; k <= constants.r; k += constants.Delta) {
        /*if(k< constants.Delta){
         time=1;
         }else{
         time=60;
         }*/
        for (var times = 0; times < time; times += 1) {
            var hudu = (2 * Math.PI / 360) * 6 * times;
            var x = Math.sin(hudu) * k;
            var y = -Math.cos(hudu) * k;    //  注意此处是“-”号，因为我们要得到的Y是相对于（0,0）而言的。
            this.points[i] = point(x, y, this.equation(x, y)); // 根据函数生成高
            ++i;
        }

    }

}

// -----------------------------------------------------------------------------------------------------
let kkk = 0;
Surface.prototype.color = function ()   //生成颜色的  color1渐变前  color2 渐变后  看不懂不看
{

    var j = 0;
    var arr = [];
    //this.points = surface.points.sort(surface.sortByZIndex);
    for (var i = 0; i < this.points.length; i++) {
        var num = parseInt(i / 72);
        var index = i + conMapRotateY;
        var kkkg = ceshiJson[0].PM10.slice(num * 72, num * 72 + 72);
        if (index % 72 > -1) {
            index = index % 72;
        } else {
            index = 72 + index % 72;
        }
        arr = this.getColorByBaiFenBi(kkkg[index]);
        this.points[i].color1 = arr[0];
        this.points[i].color2 = arr[1];
        j++;
    }

}

// -----------------------------------------------------------------------------------------------------

function appendCanvasElement() //生成一个canvasDOM
{
    let canvasElement = document.createElement('canvas');

    canvasElement.width = constants.canvasWidth;
    canvasElement.height = constants.canvasHeight;
    canvasElement.id = "myCanvas";

    canvasElement.getContext('2d').translate(constants.canvasWidth / 2, constants.canvasHeight / 2); //移动canvas的中心店
    myCanvas = canvasElement;
    ctx = myCanvas.getContext("2d");
}

//------------------------------------------------------------------------------------------------------

Surface.prototype.sortByZIndex = function (A, B) {
    return A[Z] - B[Z]; //根据高度排序
}

// -----------------------------------------------------------------------------------------------------

Surface.prototype.draw = function () {
    this.drawBg()
    this.drawPoint();
}

Surface.prototype.drawBg = function () {
    //this.points = surface.points.sort(surface.sortByZIndex);
    if (!ctx) { return }
    ctx.beginPath();
    ctx.moveTo(0, 0);
    for (var i = 0; i < this.points.length; i++) {
        var x = this.points[i][X] * constants.surfaceScale,
            y = this.points[i][Y] * constants.surfaceScale;

        ctx.lineTo(x, y);
    }
    ctx.fillStyle = "rgba(0,51,102,.8)";
    ctx.strokeStyle = "rgba(55,96,153,.8)";
    ctx.fill();
    //ctx.stroke();
    ctx.closePath();

}


Surface.prototype.drawPoint = function () {
    if (!ctx) { return }
    //ctx.beginPath();

    //var start=[0,0];
    // ctx.moveTo(start[0],start[1]);
    for (var i = 0; i < this.points.length; i++) {
        //ctx.moveTo(start[0],start[1]);
        if (this.points[i].color1 == 0) {
            continue;
        }
        var num = parseInt(i / 72);
        var x = (this.points[i][X]) * constants.surfaceScale,
            y = this.points[i][Y] * constants.surfaceScale;
        //start=[x,y];
        ctx.fillStyle = this.points[i].color1;
        //ctx.fillRect( x - (constants.pointWidth/2), y - (constants.pointHeight/2), constants.pointWidth, constants.pointHeight);
        ctx.fillRect(x, y, 2, 2);
        //ctx.lineTo(x,y);
        //ctx.fillStyle=this.points[i].color1;
        //ctx.strokeStyle=this.points[i].color1;

        //ctx.stroke();

        //ctx.fill();

    }
    //ctx.closePath();

}

Surface.prototype.getColorByBaiFenBi = function (bili) {
    if (bili) {
        bili = bili > 100 ? 100 : bili;
        var one = (255 + 255) / 100;
        var r = 0;
        var g = 0;
        var b = 0;

        if (bili < 50) {
            // 比例小于50的时候红色是越来越多的,直到红色为255时(红+绿)变为黄色.
            r = one * bili;
            g = 255;
        }
        if (bili >= 50) {
            // 比例大于50的时候绿色是越来越少的,直到0 变为纯红
            g = 255 - ((bili - 50) * one);
            r = 255;
        }
        r = parseInt(r);// 取整
        g = parseInt(g);// 取整
        b = parseInt(b);// 取整
        return ["rgba(" + r + "," + g + "," + b + ",1)", "rgba(" + r + "," + g + "," + b + ",0)"];
    } else {
        return [0, 0];
        //return ["rgba(0,51,102,1)","rgba(0,51,102,0)"];
    }
}



// -----------------------------------------------------------------------------------------------------

Surface.prototype.multi = function (R) {
    let Px = 0, Py = 0, Pz = 0; // let iables to hold temporary results.
    let P = this.points; // P is a pointer to the set of surface points (i.e., the set of 3 x 1 vectors).
    let sum; // The sum for each row/column matrix product.

    for (let V = 0; V < P.length; V++) // For all 3 x 1 vectors in the point list.
    {
        Px = P[V][X], Py = P[V][Y], Pz = P[V][Z];
        for (let Rrow = 0; Rrow < 3; Rrow++) // For each row in the R matrix.
        {
            sum = (R[Rrow][X] * Px) + (R[Rrow][Y] * Py) + (R[Rrow][Z] * Pz);
            P[V][Rrow] = sum;
        }
    }
}

// -----------------------------------------------------------------------------------------------------

Surface.prototype.erase = function () {
    if (ctx) {
        ctx.clearRect(-constants.canvasWidth / 2, -constants.canvasHeight / 2, myCanvas.width, myCanvas.height);
    }
}

// -----------------------------------------------------------------------------------------------------

Surface.prototype.xRotate = function (sign) {
    let Rx = [[0, 0, 0],
    [0, 0, 0],
    [0, 0, 0]];

    Rx[0][0] = 1;
    Rx[0][1] = 0;
    Rx[0][2] = 0;
    Rx[1][0] = 0;
    Rx[1][1] = Math.cos(sign * constants.dTheta);
    Rx[1][2] = -Math.sin(sign * constants.dTheta);
    Rx[2][0] = 0;
    Rx[2][1] = Math.sin(sign * constants.dTheta);
    Rx[2][2] = Math.cos(sign * constants.dTheta);

    this.multi(Rx);
    this.erase();
    let context = canvas.getContext('2d');
    context.clearRect(0, 0, canvas.width, canvas.height);
    this.draw();
}

